// @esversion    6
// ==/UserScript==

$(function () {
  function addContent(jsonData) {
    let contentParagraph = "";
    for (let ii = 0; ii < jsonData.length; ii++) {
      switch (jsonData[ii].type) {
        case "text":
          contentParagraph += jsonData[ii].data;
          break;
        case "tag":
          let attr = "";
          Object.keys(jsonData[ii].attribs).forEach(function (key) {
            attr += " " + key + '="' + jsonData[ii].attribs[key] + '"';
          });
          contentParagraph +=
            "<" +
            jsonData[ii].name +
            attr +
            ">" +
            addContent(jsonData[ii].children) +
            "</" +
            jsonData[ii].name +
            ">";
          break;
        default:
          contentParagraph += "<u>" + JSON.stringify(jsonData[ii]) + "</u>";
          break;
      }
    }
    return contentParagraph;
  }

  const adss = [
    ".layout-sticky-rail-advert-wrapper",
    "#tp-regwall",
    "#AdBillboard",
    "#gpt-ad-slot-right-rail-r0",
    "#gpt-ad-slot-regwall",
    "#gpt-ad-slot-regwall",
    ".newsletter-signup",
    "#_evidon_banner",
    `[class^="adComp"]`, // Êñ∞Ê∑ªÂä†‰∏Ä‰∏™bannerÂπøÂëäÁöÑÂ±èËîΩ
  ];
  let counter = 10;
  let repeatTime = 5;
  let flag = false;
  console.log("Âà†Èô§ÂπøÂëä‰∏≠");
  let timer1 = setInterval(() => {
    adss.forEach((item) => {
      if ($(item)) {
        document.querySelectorAll(".advert").forEach((e) => e.remove()); //Âà†Èô§ÂπøÂëä
        $(item).remove();
        repeatTime--;
        flag = true;
      }
    });
    counter--;
    if (repeatTime == 0 || counter == 0 || flag == false) {
      clearInterval(timer1);
      console.log("Âà†Èô§ÂπøÂëäÂÆåÊàê");
    }
  }, 500);

  //ÈÄâÂèñÊñáÁ´†ÂÖÉÁ¥†
  let postQuery = "#content p.article__body-text";
  //ÈÄâÂèñÊñáÁ´†ÂÜÖÂÆπJson
  let nextData = $("#__NEXT_DATA__");
  let contentParent =
    "#new-article-template > div > div:nth-child(1) > div:nth-child(3) > div section > div:nth-child(1)";
  let addContentTimer = setInterval(() => {
    if ($(postQuery).length <= 2) {
      $(postQuery) ? $(postQuery).remove() : 0;

      //ÈáçÊñ∞Â°´ÂÖÖÂÜÖÂÆπ
      if (nextData.length) {
        //ÊâæÂá∫ÊñáÁ´†ÂÜÖÂÆπ   ---ËøôÈáå‰øÆÊîπÂ•Ω‰∫Ü
        console.log({
          "ÊµãËØïÊòØÂê¶ÊúâÂÜÖÂÆπ:": JSON.parse(nextData[0].textContent).props.pageProps
            .content[0].text,
        });
        let data = JSON.parse(nextData[0].textContent).props.pageProps
          .content[0].text;
        let figureFlag = false;
        let contentParagraph = "";
        for (let i = 0; i < data.length; i++) {
          if (data[i].type == "tag") {
            switch (data[i].name) {
              case "p":
                contentParagraph +=
                  '<p class="article__body-text">' +
                  addContent(data[i].children) +
                  "</p>";
                break;
              case "figure":
                if (
                  data[i].attribs.itemtype == "https://schema.org/ImageObject"
                ) {
                  for (let ii = 0; ii < data[i].children.length; ii++) {
                    if (data[i].children[ii].name == "img") {
                      if (figureFlag) {
                        contentParagraph += "</div>";
                        figureFlag = false;
                      }
                      contentParagraph +=
                        '<div class="article__body-text-image"><figure><div><img src="' +
                        data[i].children[ii].attribs.src +
                        '"' +
                        'style="/*height:' +
                        data[i].children[ii].attribs.height +
                        "px;width:" +
                        data[i].children[ii].attribs.width +
                        'px*/"' +
                        "></div></figure>";
                      figureFlag = true;
                    }
                  }
                }
                break;
              case "h2":
                contentParagraph +=
                  "<h2>" + addContent(data[i].children) + "</h2>";
                break;
              default:
                contentParagraph +=
                  "<" +
                  data[i].name +
                  ">" +
                  addContent(data[i].children) +
                  "</" +
                  data[i].name +
                  ">" +
                  ">";
                break;
            }
          }
        }
        if (figureFlag) {
          contentParagraph += "</div>";
          figureFlag = false;
        }
        console.log("Áà∂ËäÇÁÇπ", $(contentParent));
        $(contentParent).append(contentParagraph);
      }
      clearInterval(addContentTimer);
      // console.log("ËÑöÊú¨ËøêË°åÂÆåÊØï")
    }
  }, 1000);
});
